import React from 'react';
import {Button} from '../ButtonElements';
import{
InfoContainer,
InfoWrapper,
InfoRow,
Column1,
TextWrapper,
TopLine,
Heading,
Subtitle,
BtnWrap,
Column2,
ImgWrap,
Img 
} from './InfoElements';

const InfoSection = (
    {
        id, lightBg, imgStart, topLine, lightText, headLine, darkText, description, buttonLabel, buttonLabel1, buttonLabel2, img, alt, primary, dark, dark2 
    }    ) => {
    return (
        <>
          <InfoContainer lightBg={lightBg} id={id}>
            <InfoWrapper>
                <InfoRow imgStart={imgStart}>
                    <Column1>
                        <TextWrapper>
                            <TopLine>{topLine}</TopLine>
                            <Heading lightText={lightText}>{headLine}</Heading>
                            <Subtitle darkText={darkText}>{description}</Subtitle>
                            <BtnWrap>
                                <Button to="home"
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                primary={primary ? 1 : 0 }
                                dark={ dark ? 1 : 0}
                                dark2={dark2 ? 1 : 0}
                                >{buttonLabel}</Button>
                                
                                <Button to="home"
                                display={ display ? 1: 0}
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                primary={primary ? 1 : 0 }
                                dark={ dark ? 1 : 0}
                                dark2={dark2 ? 1 : 0}
                                >{buttonLabel1}</Button>
                                
                                <Button to="home"
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                primary={primary ? 1 : 0 }
                                dark={ dark ? 1 : 0}
                                dark2={dark2 ? 1 : 0}
                                >{buttonLabel2}</Button>
                            </BtnWrap>
                        </TextWrapper>
                    </Column1>
                    <Column2>
                        <ImgWrap>
                            <Img src={img} alt={alt}/>
                        </ImgWrap>
                    </Column2>
                </InfoRow>
            </InfoWrapper>
          </InfoContainer>  
        </>
    )
}

export default InfoSection
